import {Routes, Route, useNavigate} from 'react-router-dom';

export default function App() {
  const navigate = useNavigate();

  const navigateTest0 = () => {
    navigate('/test0');
  };

  const navigateTest1 = () => {
    navigate('/test1');
  };

  return (
    <div>
      <div>
        <button onClick={navigateTest0}>Test0</button>
        <hr />
        <button onClick={navigateTest1}>Test1</button>

        <Routes>
          <Route path="/test0" element={<Test0 />} />
          <Route path="/test1" element={<Test1 />} />
        </Routes>
      </div>
    </div>
  );
}

function Test0() {
  return <h2>t0</h2>;
}

function Test1() {
  return <h2>t1</h2>;
}
